import React from 'react';

const Divider = (props, selected) => {
  console.log(selected);
  return (
      <div className="divider {{selected}}" onClick={(e) => {
          e.stopPropagation();
          props.onDividerClick(props);
      }}>{props.divider}</div>
  );
}

export default Divider;
